Course.create({"id"=>1, "name"=>"Writing", "code"=>"1111", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/writing_100x100_rbvmxk.png", "featured"=>true, "tuition_cost"=>0, "short_desc"=>"Short story writing.", "long_desc"=>"Shields up! I recommend we transfer power to phasers and arm the photon torpedoes. Something strange on the detector circuit. The weapons must have disrupted our communicators. You saw something as tasty as meat, but inorganically materialized out of patterns used by our transporters. Captain, the most elementary and valuable statement in science, the beginning of wisdom, is I do not know. All transporters off.", "created_at"=>"Thu, 11 Jun 2020 18:57:35 UTC +00:00", "updated_at"=>"Tue, 09 Jun 2020 22:17:18 UTC +00:00" })
Course.create({"id"=>2, "name"=>"Math", "code"=>"2222", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/math_100x100_no9cxv.png", "featured"=>false, "tuition_cost"=>20, "short_desc"=>"Build fundamentals.", "long_desc"=>"Unidentified vessel travelling at sub warp speed, bearing 235.7. Fluctuations in energy readings from it, Captain. All transporters off. A strange set-up, but Id say the graviton generator is depolarized. The dark colourings of the scrapes are the leavings of natural rubber, a type of non-conductive sole used by researchers experimenting with electricity. The molecules must have been partly de-phased by the anyon beam.", "created_at"=>"Thu, 11 Jun 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 11 Jun 2020 18:57:35 UTC +00:00" })
Course.create({"id"=>3, "name"=>"Physics", "code"=>"3333", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/physics_100x100_ktftri.png", "featured"=>false, "tuition_cost"=>0, "short_desc"=>"Matter and energy.", "long_desc"=>"Now what are the possibilities of warp drive? Cmdr Rikers nervous system has been invaded by an unknown microorganism. The organisms fuse to the nerve, intertwining at the molecular level. Thats why the transporters biofilters couldnt extract it. The vertex waves show a K-complex corresponding to an REM state. The engineering sections critical. Destruction is imminent. Their robes contain ultritium, highly explosive, virtually undetectable by your transporter.", "created_at"=>"Thu, 11 Jun 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 11 Jun 2020 19:17:41 UTC +00:00" })
